  {title: "What is \"self\" in Ruby? ", body: "{\"blocks\":[{\"key\":\"eg90\",\"text\":\"I keep seeing self being used in Ruby code, what is its use? \",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}}],\"entityMap\":{}}", user_id: 30},
  {title: "Where do you put the favicon in a rails app? ", body: "{\"blocks\":[{\"key\":\"ff28d\",\"text\":\"Which part of the application do you place the favicon.png file? And where do you load the file from? Is it the application.html.erb file? \",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[{\"offset\":47,\"length\":11,\"style\":\"CODE\"},{\"offset\":112,\"length\":20,\"style\":\"CODE\"}],\"entityRanges\":[],\"data\":{}}],\"entityMap\":{}}", user_id: 30},
  {title: "How can I add timestamps to an existing table in Rails?", body: "{\"blocks\":[{\"key\":\"3q00e\",\"text\":\"I accidentally already migrated a table and forgot to add the command t.timestamps. As a result, the two automatically added columns created_at and updated_at are missing in my schema.rb file. \",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[{\"offset\":70,\"length\":12,\"style\":\"CODE\"},{\"offset\":133,\"length\":10,\"style\":\"CODE\"},{\"offset\":148,\"length\":10,\"style\":\"CODE\"},{\"offset\":177,\"length\":9,\"style\":\"CODE\"}],\"entityRanges\":[],\"data\":{}},{\"key\":\"611dd\",\"text\":\"\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}},{\"key\":\"fqsnq\",\"text\":\"I tried to do something like this, but it failed: \",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}},{\"key\":\"d97ke\",\"text\":\"\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}},{\"key\":\"eri0t\",\"text\":\"class AddTimeStampsToQuestions < ActiveRecord::Migration \\n    def change_table\\n        add_timestamps(:questions)\\n    end\\nend\",\"type\":\"code-block\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}}],\"entityMap\":{}}", user_id: 30},
  {title: "What does ACID stand for? ", body: "{\"blocks\":[{\"key\":\"9n897\",\"text\":\"I keep hearing the term ACID being thrown around with respect to databases? What does this stand for? \",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[{\"offset\":24,\"length\":4,\"style\":\"BOLD\"}],\"entityRanges\":[],\"data\":{}}],\"entityMap\":{}}", user_id: 30},
  {title: "Implementing a custom search route? ", body: "{\"blocks\":[{\"key\":\"fmudc\",\"text\":\"How do I implement a custom search route in Rails? \",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}}],\"entityMap\":{}}", user_id: 30},
  {title: "How can I capture view count for a specific page in Rails? ", body: "{\"blocks\":[{\"key\":\"735is\",\"text\":\"I have an application where I'm listing question show pages. Every single time a user visits a question show page, I want to update a \\\"visit\\\" counter, because I want to display this information in my frontend. \",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}},{\"key\":\"3cesa\",\"text\":\"\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}},{\"key\":\"k36k\",\"text\":\"Is there a method in Rails, or perhaps a library I can use to capture views? \",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}}],\"entityMap\":{}}", user_id: 30},
  {title: "When I run the rails:db migrate command, I get the error message \"Uninitialized constant CreateVotes\"", body: "{\"blocks\":[{\"key\":\"95a7c\",\"text\":\"I created a migration file (the one below), but when I tried to run it I get this error  \\\"Uninitialized constant CreateVotes\\\"? \",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}},{\"key\":\"2a647\",\"text\":\"\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}},{\"key\":\"fnn6i\",\"text\":\"\\n class CreateVotable < ActiveRecord::Migration[5.2]\\n    def change\\n        create_table :votes do |t|\\n            t.integer :value\\n            t.integer :user_id, null: false\\n            t.integer :voteable_id\\n            t.string :voteable_type\\n            t.timestamps\\n        end\\n    end \\n   end \",\"type\":\"code-block\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}},{\"key\":\"6ajdf\",\"text\":\"\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}},{\"key\":\"365p5\",\"text\":\"Can anyone tell me why this error shows up? \",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}}],\"entityMap\":{}}", user_id: 30},
  {title: "What are some good fundamental data structures to look at? ", body: "{\"blocks\":[{\"key\":\"cmh8s\",\"text\":\"So far, my current list is: \",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}},{\"key\":\"bkkub\",\"text\":\"\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}},{\"key\":\"8eeqp\",\"text\":\"linked lists (singly and doubly) \",\"type\":\"unordered-list-item\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}},{\"key\":\"57gq\",\"text\":\"array \",\"type\":\"unordered-list-item\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}},{\"key\":\"545av\",\"text\":\"hash table \",\"type\":\"unordered-list-item\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}},{\"key\":\"7dbpe\",\"text\":\"trees \",\"type\":\"unordered-list-item\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}},{\"key\":\"c68lj\",\"text\":\"heaps \",\"type\":\"unordered-list-item\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}},{\"key\":\"4iaqv\",\"text\":\"graphs \",\"type\":\"unordered-list-item\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}},{\"key\":\"8ju42\",\"text\":\"\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}},{\"key\":\"4slhj\",\"text\":\"Is there anything else I'm missing? \",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}}],\"entityMap\":{}}", user_id: 30},
  {title: "Can someone explain to me what \"truthy\" and \"falsy\" values are in Javascript?", body: "{\"blocks\":[{\"key\":\"58nff\",\"text\":\"So it's my understanding that there are some \\\"truthy\\\" and some \\\"falsy\\\" values in Javascript. \",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}},{\"key\":\"3jk70\",\"text\":\"\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}},{\"key\":\"124c7\",\"text\":\"So for example, if I do something like: \",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}},{\"key\":\"72ru3\",\"text\":\"\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}},{\"key\":\"3b5a3\",\"text\":\"Boolean(0) // false  \\nBoolean(\\\"0\\\") // true\\nBoolean(undefined) // false\",\"type\":\"code-block\",\"depth\":0,\"inlineStyleRanges\":[{\"offset\":0,\"length\":21,\"style\":\"CODE\"},{\"offset\":22,\"length\":20,\"style\":\"CODE\"},{\"offset\":43,\"length\":27,\"style\":\"CODE\"}],\"entityRanges\":[],\"data\":{}},{\"key\":\"5goot\",\"text\":\"\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}},{\"key\":\"dogj8\",\"text\":\"Besides \\\"0\\\" and undefined, are there any other falsy values? Is an empty object a falsy value, for example? \",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[{\"offset\":47,\"length\":5,\"style\":\"BOLD\"}],\"entityRanges\":[],\"data\":{}}],\"entityMap\":{}}", user_id: 30},
  {title: "What are arrow functions? ", body: "{\"blocks\":[{\"key\":\"50rgh\",\"text\":\"I see in Javascript that sometimes you can transform regular functions into arrow functions. What are arrow functions, and how do they differ from regular functions? \",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}}],\"entityMap\":{}}", user_id: 30},
  {title: "Adjust line height between lines of text", body: "{\"blocks\":[{\"key\":\"4cotb\",\"text\":\"Is there a CSS property that adjusts the line height between text?\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}}],\"entityMap\":{}}", user_id: 30},
  {title: "Is there a way to convert snake case in ruby to camel case in my jbuilder file? ", body: "{\"blocks\":[{\"key\":\"cspkg\",\"text\":\"Is there a way to structure my jbuilder file so that any key that is snake-cased automatically gets converted to camel case? I'm using a rails backend and a react/redux frontend, so I'd like to be able to use Javascript's camel case notation there. \",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}}],\"entityMap\":{}}", user_id: 30},
  {title: "What is the difference between a binary tree and a binary search tree? ", body: "{\"blocks\":[{\"key\":\"7u10p\",\"text\":\"Can someone explain the difference between a binary tree and a binary search tree, possibly using examples? I would like to know more. \",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[{\"offset\":45,\"length\":11,\"style\":\"BOLD\"},{\"offset\":63,\"length\":18,\"style\":\"BOLD\"}],\"entityRanges\":[],\"data\":{}}],\"entityMap\":{}}", user_id: 30},
  {title: "In plain terms, what is Big O notation? ", body: "{\"blocks\":[{\"key\":\"srns\",\"text\":\"Can someone give some examples? \",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}}],\"entityMap\":{}}", user_id: 30},
  {title: "How do I implement rich text editing in a rails application with a React frontend? ", body: "{\"blocks\":[{\"key\":\"f0q95\",\"text\":\"Is there an easy way to implement a rich text editor in a react component? Maybe a library? \",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}}],\"entityMap\":{}}", user_id: 30},
  {title: "Eliminate the flash of unstyled content", body: "{\"blocks\":[{\"key\":\"51lp2\",\"text\":\"How do I stop the flash of unstyled content (FOUC) on a website? \",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[{\"offset\":45,\"length\":4,\"style\":\"CODE\"}],\"entityRanges\":[],\"data\":{}}],\"entityMap\":{}}", user_id: 30},
  {title: "How do I find the running median from a data stream? ", body: "{\"blocks\":[{\"key\":\"59hu1\",\"text\":\"So the problem is that we have a stream of integer values. I would like to write an algorithm that calculates the running median. So something like: \",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}},{\"key\":\"2bn0r\",\"text\":\"\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}},{\"key\":\"jm6e\",\"text\":\"[3, 2]\",\"type\":\"code-block\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}},{\"key\":\"3vqkb\",\"text\":\"\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}},{\"key\":\"1hsnc\",\"text\":\"the median would be 2.5, and for: \",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}},{\"key\":\"b6vf9\",\"text\":\"\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}},{\"key\":\"8lb1m\",\"text\":\"\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}},{\"key\":\"egshb\",\"text\":\"[3, 2, 5]\",\"type\":\"code-block\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}},{\"key\":\"19u5k\",\"text\":\"\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}},{\"key\":\"58n6m\",\"text\":\"the median would be 3, and so on. I've heard that maybe the heap data structure might be useful, but I'm not sure how? \",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}}],\"entityMap\":{}}", user_id: 30},
  {title: "What is the difference between a hash, a hash set and a hash table? ", body: "{\"blocks\":[{\"key\":\"a9u1s\",\"text\":\"What I'm confused about is that I hear the term hash being thrown around a lot. It's to my understanding that colloquially, hash is a short-hand term for hash table. \",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[{\"offset\":48,\"length\":4,\"style\":\"BOLD\"},{\"offset\":124,\"length\":4,\"style\":\"BOLD\"},{\"offset\":154,\"length\":10,\"style\":\"BOLD\"},{\"offset\":165,\"length\":1,\"style\":\"BOLD\"}],\"entityRanges\":[],\"data\":{}},{\"key\":\"c59o3\",\"text\":\"\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}},{\"key\":\"4v31r\",\"text\":\"However, I've also heard the term hash being used in terms of something like a hashing function. Is that what most people mean when they say \\\"hash\\\"? \",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[{\"offset\":34,\"length\":4,\"style\":\"BOLD\"},{\"offset\":79,\"length\":16,\"style\":\"BOLD\"}],\"entityRanges\":[],\"data\":{}},{\"key\":\"d6n31\",\"text\":\"\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}},{\"key\":\"9oepb\",\"text\":\"Also, just to clarify, is the difference between a \\\"hash set\\\" and a \\\"hash table\\\" that one of them only stores keys, and the other stores both keys and values? \",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}}],\"entityMap\":{}}", user_id: 30},
  {title: "Dynamically convert a string into a constant in Ruby? ", body: "{\"blocks\":[{\"key\":\"1crdr\",\"text\":\"Here is the issue. I have a votes.rb model that I am trying to add the instance method add_reputation to. A row in this votes table has a voteable_type, which is either a \\\"Question\\\" or an \\\"Answer\\\". \",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[{\"offset\":28,\"length\":9,\"style\":\"CODE\"},{\"offset\":87,\"length\":14,\"style\":\"CODE\"},{\"offset\":120,\"length\":5,\"style\":\"CODE\"},{\"offset\":138,\"length\":13,\"style\":\"CODE\"},{\"offset\":171,\"length\":10,\"style\":\"CODE\"},{\"offset\":188,\"length\":8,\"style\":\"CODE\"}],\"entityRanges\":[],\"data\":{}},{\"key\":\"5joa\",\"text\":\"\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}},{\"key\":\"da2k3\",\"text\":\"When someone upvotes on a particular question or answer, I want to find the user who created that question/answer, and add to that user's reputation (I have an add_reputation method on my user model). \",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[{\"offset\":160,\"length\":14,\"style\":\"CODE\"}],\"entityRanges\":[],\"data\":{}},{\"key\":\"37cup\",\"text\":\"\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}},{\"key\":\"ddctu\",\"text\":\"Currently, I have something that looks like this: \",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}},{\"key\":\"5n969\",\"text\":\"\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}},{\"key\":\"6jc1c\",\"text\":\"def add_reputation\\n    id = self.voteable_id \\n    type = self.voteable_type \\n    \\n    if type == 'Question' \\n        question = Question.find(id) \\n        question.user.add_reputation(10)\\n    end \\n    \\n    if type == 'Answer' \\n        answer = Answer.find(id) \\n        answer.user.add_reputation(10) \\n    end\\nend\",\"type\":\"code-block\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}},{\"key\":\"1tff0\",\"text\":\"\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}},{\"key\":\"ammi\",\"text\":\"Is there a way I can convert the getter/setter method voteable_type from a string into a symbol, so that I can do this dynamically without the conditional? \",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[{\"offset\":54,\"length\":13,\"style\":\"CODE\"}],\"entityRanges\":[],\"data\":{}}],\"entityMap\":{}}", user_id: 30},
  {title: "What is the difference between \"===\" and \"==\" in Javascript?", body: "{\"blocks\":[{\"key\":\"14ght\",\"text\":\"I see \\\"===\\\" being used all the time, but doesn't \\\"==\\\" work just as well? \",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}}],\"entityMap\":{}}", user_id: 30},
  {title: "What is Redux? ", body: "{\"blocks\":[{\"key\":\"34q1n\",\"text\":\"When do I need to use Redux with my React component? I know that Redux is a state management library. \",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}},{\"key\":\"tls3\",\"text\":\"\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}},{\"key\":\"3i3cr\",\"text\":\"Is there a certain point when developing an application where it's a good idea to start integrating Redux? Like a rule of thumb? \",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}}],\"entityMap\":{}}", user_id: 30},
  {title: "What is an ORM? ", body: "{\"blocks\":[{\"key\":\"ehuh3\",\"text\":\"Can someone explain what an object relational mapping is? \",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[{\"offset\":28,\"length\":26,\"style\":\"BOLD\"}],\"entityRanges\":[],\"data\":{}}],\"entityMap\":{}}", user_id: 30},
  {title: "Can I chain on .where() with multiple conditions?", body: "{\"blocks\":[{\"key\":\"8thjg\",\"text\":\"I'm trying to find a particular record in my table using multiple tables. So for example, I have a taggables table, and there are three columns: tag_id, taggable_id, taggable_type. The intersection of these three is unique, so I would like to do something like: \",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[{\"offset\":99,\"length\":9,\"style\":\"CODE\"},{\"offset\":145,\"length\":34,\"style\":\"CODE\"}],\"entityRanges\":[],\"data\":{}},{\"key\":\"bu2e3\",\"text\":\"\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}},{\"key\":\"ei14i\",\"text\":\"Taggable.find by(tag_id: tag_id, taggable_id: taggable_id, taggable_type: taggable_type)\",\"type\":\"code-block\",\"depth\":0,\"inlineStyleRanges\":[{\"offset\":17,\"length\":71,\"style\":\"CODE\"}],\"entityRanges\":[],\"data\":{}},{\"key\":\"2mrdq\",\"text\":\"\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}},{\"key\":\"26r27\",\"text\":\"Is this possible?\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[{\"offset\":0,\"length\":17,\"style\":\"CODE\"}],\"entityRanges\":[],\"data\":{}}],\"entityMap\":{}}", user_id: 30},
