  {title: "How do I connect the foreign key in my votes table to both the questions and the answers table?", body: "{\"blocks\":[{\"key\":\"b2e2e\",\"text\":\"So currently I'm trying to implement a votes table for my full stack project. The issue is that a vote is connected to more than one table (namely, a questions table and an answers table). If the vote was only connected to the question, I would have two keys in my votes table: \",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}},{\"key\":\"b3ekg\",\"text\":\"\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}},{\"key\":\"84d16\",\"text\":\"id: integer \\nquestion_id: integer <- foreign key referencing questions table\",\"type\":\"code-block\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}},{\"key\":\"eprg0\",\"text\":\"\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}},{\"key\":\"3ek24\",\"text\":\"Alternatively, if I only had the answers table to worry about, I would have something like this: \",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}},{\"key\":\"batob\",\"text\":\"\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}},{\"key\":\"7a6lo\",\"text\":\"id: integer \\nanswer_id: integer\",\"type\":\"code-block\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}},{\"key\":\"b0v33\",\"text\":\"\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}},{\"key\":\"8tfeh\",\"text\":\"Is there a way in rails to do this easily? \",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}}],\"entityMap\":{}}", user_id: 30},
  {title: "Why is building a heap O(n) time complexity? ", body: "{\"blocks\":[{\"key\":\"8bffa\",\"text\":\"I'm trying to understand why building a heap is O(n) time complexity. Let's say there are n nodes we want to insert into our heap. It's to my understanding that the worst case time complexity for inserting an element into a heap is O(log n), since the worst possible case involves sifting the node all the way up to the root, and the heap's hight is at most O(log n). \",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[{\"offset\":48,\"length\":4,\"style\":\"CODE\"},{\"offset\":90,\"length\":1,\"style\":\"CODE\"},{\"offset\":232,\"length\":8,\"style\":\"CODE\"},{\"offset\":358,\"length\":10,\"style\":\"CODE\"},{\"offset\":165,\"length\":26,\"style\":\"BOLD\"},{\"offset\":367,\"length\":1,\"style\":\"ITALIC\"}],\"entityRanges\":[],\"data\":{}},{\"key\":\"9ajr0\",\"text\":\"\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}},{\"key\":\"6v4u7\",\"text\":\"So in this situation, wouldn't the time complexity be O(n log n)? \",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[{\"offset\":54,\"length\":10,\"style\":\"CODE\"}],\"entityRanges\":[],\"data\":{}},{\"key\":\"e7pek\",\"text\":\"\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}},{\"key\":\"1pg4c\",\"text\":\"What am I not getting? \",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}}],\"entityMap\":{}}", user_id: 30},
  {title: "Is there a way to have more than one seeds.rb file? ", body: "{\"blocks\":[{\"key\":\"e99a6\",\"text\":\"I know that Rails comes prepackaged with a seeds.rb file which it runs whenever the command rails db:seed is executed. However, is it possible to have multiple seeds files, each file potentially for a different model? \",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[{\"offset\":43,\"length\":8,\"style\":\"CODE\"},{\"offset\":92,\"length\":13,\"style\":\"CODE\"}],\"entityRanges\":[],\"data\":{}},{\"key\":\"113eh\",\"text\":\"\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}},{\"key\":\"cq125\",\"text\":\"In other words, let's say I have a users model and a questions model. Is there any way I can have a seeds file that is only related to seeding the users table, and a separate seeds file related to only seeding the questions table? And then is there a command I can do to run them both? \",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}},{\"key\":\"e6vds\",\"text\":\"\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}},{\"key\":\"d8eh1\",\"text\":\"Or is there maybe a library that does this? \",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}}],\"entityMap\":{}}", user_id: 30},
