  {title: "Multiple lines of input in <input type=“text” />", body: "{\"blocks\":[{\"key\":\"42veh\",\"text\":\"I have this text input in a form:\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}},{\"key\":\"44ruj\",\"text\":\"\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}},{\"key\":\"7laps\",\"text\":\"<input type=\\\"text\\\"\\n       cols=\\\"40\\\" \\n       rows=\\\"5\\\" \\n       style=\\\"width:200px; height:50px;\\\" \\n       name=\\\"Text1\\\" \\n       id=\\\"Text1\\\" \\n       value=\\\"\\\" />\",\"type\":\"code-block\",\"depth\":0,\"inlineStyleRanges\":[{\"offset\":0,\"length\":154,\"style\":\"CODE\"}],\"entityRanges\":[],\"data\":{}},{\"key\":\"6cl1s\",\"text\":\"\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}},{\"key\":\"5jurs\",\"text\":\"I am trying to get it to take multiple lines of input. The width and height make the box to be bigger, but the user can enter text all (s)he wants yet it fills one line only.\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}},{\"key\":\"9h5ek\",\"text\":\"\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}},{\"key\":\"9mb93\",\"text\":\"How do I make the input more like a textarea?\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}}],\"entityMap\":{}}", user_id: 30},
  {title: "How do I revert a Git repository to a previous commit?", body: "{\"blocks\":[{\"key\":\"gfo9\",\"text\":\"How do I revert from my current state to a snapshot made on a certain commit?\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}},{\"key\":\"6setk\",\"text\":\"\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}},{\"key\":\"2jlp6\",\"text\":\"If I do git log, then I get the following output:\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[{\"offset\":8,\"length\":7,\"style\":\"CODE\"}],\"entityRanges\":[],\"data\":{}},{\"key\":\"bht27\",\"text\":\"\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}},{\"key\":\"d2m36\",\"text\":\"$ git log\\ncommit a867b4af366350be2e7c21b8de9cc6504678a61b`\\nAuthor: Me <me@me.com>\\nDate:   Thu Nov 4 18:59:41 2010 -0400\\n\\nblah blah blah...\\n\\ncommit 25eee4caef46ae64aa08e8ab3f988bc917ee1ce4\\nAuthor: Me <me@me.com>\\nDate:   Thu Nov 4 05:13:39 2010 -0400\\n\\nmore blah blah blah...\\n\\ncommit 0766c053c0ea2035e90f504928f8df3c9363b8bd\\nAuthor: Me <me@me.com>\\nDate:   Thu Nov 4 00:55:06 2010 -0400\\n\\nAnd yet more blah blah...\\n\\ncommit 0d1d7fc32e5a947fbd92ee598033d85bfc445a50\\nAuthor: Me <me@me.com>\\nDate:   Wed Nov 3 23:56:08 2010 -0400\\n\\nYep, more blah blah.\",\"type\":\"code-block\",\"depth\":0,\"inlineStyleRanges\":[{\"offset\":0,\"length\":541,\"style\":\"CODE\"}],\"entityRanges\":[],\"data\":{}},{\"key\":\"dkoid\",\"text\":\"\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}},{\"key\":\"42mfr\",\"text\":\"How do I revert to the commit from November 3, i.e. commit 0d1d7fc?\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[{\"offset\":59,\"length\":7,\"style\":\"CODE\"}],\"entityRanges\":[],\"data\":{}}],\"entityMap\":{}}", user_id: 30},
  {title: "How do I create a 2D array in JS? ", body: "{\"blocks\":[{\"key\":\"5u7j4\",\"text\":\"I'm trying to create a two dimensional array in Javascript. I know we can do something like this: \",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}},{\"key\":\"2oiu3\",\"text\":\"\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}},{\"key\":\"6j0vf\",\"text\":\"function createMatrix(rows, cols) {\\n    const matrix = [];  \\n    for (let i = 0; i < rows.length; i++) {     \\n        let row = [];     \\n        for (let j = 0; j < cols.length; j++} {\\n            row.push(null); \\n        }\\n        matrix.push(row); \\n    }\\n    return matrix; \\n}\",\"type\":\"code-block\",\"depth\":0,\"inlineStyleRanges\":[{\"offset\":40,\"length\":20,\"style\":\"CODE\"},{\"offset\":65,\"length\":44,\"style\":\"CODE\"},{\"offset\":118,\"length\":18,\"style\":\"CODE\"},{\"offset\":145,\"length\":39,\"style\":\"CODE\"}],\"entityRanges\":[],\"data\":{}},{\"key\":\"39na7\",\"text\":\"\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}},{\"key\":\"58fdp\",\"text\":\"\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}},{\"key\":\"c564f\",\"text\":\"but I want to know if there's a shorter, simpler way, since the way above seems a bit clunky. \",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}}],\"entityMap\":{}}", user_id: 30},
