  {title: "Ruby on Rails: How can i edit database.yml for postgresql?", body: "{\"blocks\":[{\"key\":\"3jicu\",\"text\":\"rails new app=>\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}},{\"key\":\"2fq7s\",\"text\":\"The current database.yml is like that=>\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[{\"offset\":12,\"length\":12,\"style\":\"CODE\"}],\"entityRanges\":[],\"data\":{}},{\"key\":\"2dsrf\",\"text\":\"# SQLite version 3.x\\n#   gem install sqlite3\\n#\\n#   Ensure the SQLite 3 gem is defined in your Gemfile\\n#   gem 'sqlite3'\\ndevelopment:\\n  adapter: sqlite3\\n  database: db/development.sqlite3\\n  pool: 5\\n  timeout: 5000\\n\\n# Warning: The database defined as \\\"test\\\" will be erased and\\n# re-generated from your development database when you run \\\"rake\\\".\\n# Do not set this db to the same as development or production.\\ntest:\\n  adapter: sqlite3\\n  database: db/test.sqlite3\\n  pool: 5\\n  timeout: 5000\\n\\nproduction:\\n  adapter: sqlite3\\n  database: db/production.sqlite3\\n  pool: 5\\n  timeout: 5000\",\"type\":\"code-block\",\"depth\":0,\"inlineStyleRanges\":[{\"offset\":0,\"length\":575,\"style\":\"CODE\"}],\"entityRanges\":[],\"data\":{}},{\"key\":\"2tktq\",\"text\":\"I need to edit this for postgresql database.\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}},{\"key\":\"bo9mh\",\"text\":\"\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}},{\"key\":\"96jql\",\"text\":\"How can i do this?\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}}],\"entityMap\":{}}", user_id: 30},
