  {title: "Implementing a Last Seen At Feature", body: "{\"blocks\":[{\"key\":\"ba91v\",\"text\":\"I'm trying to implement a last seen at feature in my app. Basically, when I go to a users profile page in my app, I want to see the last time they were active on my site. \",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[{\"offset\":26,\"length\":13,\"style\":\"BOLD\"}],\"entityRanges\":[],\"data\":{}},{\"key\":\"blmti\",\"text\":\"\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}},{\"key\":\"bu8ca\",\"text\":\"Is there a way to do this in Rails? \",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}}],\"entityMap\":{}}", user_id: 30},
  {title: "What is a CSS pseudoselector? ", body: "{\"blocks\":[{\"key\":\"5u7j4\",\"text\":\"Do they function the same way as regular CSS selectors? \",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}}],\"entityMap\":{}}", user_id: 30},
  {title: "What is the difference between a string and a symbol in Ruby? ", body: "{\"blocks\":[{\"key\":\"2m0ci\",\"text\":\"What is the difference between something like var and :var in Ruby? \",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[{\"offset\":46,\"length\":3,\"style\":\"CODE\"},{\"offset\":54,\"length\":4,\"style\":\"CODE\"}],\"entityRanges\":[],\"data\":{}}],\"entityMap\":{}}", user_id: 30},
  {title: "Declaring a new set in JS", body: "{\"blocks\":[{\"key\":\"43i1\",\"text\":\"How do I declare a new set in Javascript? \",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}}],\"entityMap\":{}}", user_id: 30},
  {title: "What is the difference between instance variables and class variables in Ruby? ", body: "{\"blocks\":[{\"key\":\"63d4m\",\"text\":\"Instance variables have the @ sign in front of them, and class variables have the @@ sign in front of them, but I don't understand the fundamental difference between both of these. \",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}}],\"entityMap\":{}}", user_id: 30},
  {title: "Real life use of doubly linked list", body: "{\"blocks\":[{\"key\":\"8hdg5\",\"text\":\"FO SHIZZLE\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}}],\"entityMap\":{}}", user_id: 30},
  {title: "What are real world examples of when Linked Lists should be used?", body: "{\"blocks\":[{\"key\":\"as78e\",\"text\":\"Another programmer was mentioning that they haven't found a use case for using a linked list data structure in any professional software in his career. I couldn't think of any good examples off the top of my head. He is mostly a C# and Java developer\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}},{\"key\":\"8281n\",\"text\":\"\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}},{\"key\":\"7tv0h\",\"text\":\"Can anyone give some examples where this was the correct data structure to solve a particular real world problem?\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}}],\"entityMap\":{}}", user_id: 30},
  {title: "What is the time complexity of inserting into a heap?", body: "{\"blocks\":[{\"key\":\"eb03o\",\"text\":\"Is it O(n)?\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}}],\"entityMap\":{}}", user_id: 30},
  {title: "What is \"this\" in Javascript? ", body: "{\"blocks\":[{\"key\":\"733nt\",\"text\":\"I see the keyword this being used a lot in Javascript code. Can anyone tell me what \\\"this\\\" means? And is it different from context? \",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}}],\"entityMap\":{}}", user_id: 30},
  {title: "How do you reverse a linked list (iterative and recursive)? ", body: "{\"blocks\":[{\"key\":\"1chtk\",\"text\":\"Can anyone give me a step-by-step solution for how to reverse a linked list (iteratively and recursively)? Some diagrams would help. \",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}}],\"entityMap\":{}}", user_id: 30},
  {title: "What is function hoisting in Javascript? ", body: "{\"blocks\":[{\"key\":\"aiaiu\",\"text\":\"To my understanding, is function hoisting the ability to declare a function after you use it? Like if you had the following: \",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[{\"offset\":76,\"length\":5,\"style\":\"BOLD\"}],\"entityRanges\":[],\"data\":{}},{\"key\":\"5g7el\",\"text\":\"\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}},{\"key\":\"7e8q3\",\"text\":\"printHi(\\\"Michelle\\\") // this would work\\nfunction printHi(name) {\\n    return `Hi ${name}!`; \\n}\",\"type\":\"code-block\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}},{\"key\":\"f34jh\",\"text\":\"\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}},{\"key\":\"5up1v\",\"text\":\"then the printHi(\\\"Michelle\\\") would still execute, right? \",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[{\"offset\":9,\"length\":19,\"style\":\"CODE\"}],\"entityRanges\":[],\"data\":{}},{\"key\":\"8d0b5\",\"text\":\"\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}},{\"key\":\"2jchl\",\"text\":\"Why does Javascript have function hoisting in the first place? What makes it useful? \",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}}],\"entityMap\":{}}", user_id: 30},
  {title: "What are the 7 primitive values in Javascript? ", body: "{\"blocks\":[{\"key\":\"9pioo\",\"text\":\"Some of the primitive values in Javascript that I know of are: \",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}},{\"key\":\"af9ho\",\"text\":\"\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}},{\"key\":\"7rqke\",\"text\":\"NaN\",\"type\":\"ordered-list-item\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}},{\"key\":\"33uo5\",\"text\":\"undefined\",\"type\":\"ordered-list-item\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}},{\"key\":\"fak3l\",\"text\":\"string\",\"type\":\"ordered-list-item\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}},{\"key\":\"1f8t9\",\"text\":\"integer\",\"type\":\"ordered-list-item\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}},{\"key\":\"mosh\",\"text\":\"null \",\"type\":\"ordered-list-item\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}},{\"key\":\"7o086\",\"text\":\"\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}},{\"key\":\"8qvjf\",\"text\":\"What other ones are there? \",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}}],\"entityMap\":{}}", user_id: 30},
  {title: "What is the difference between implicit and explicit returns in Javascript? ", body: "{\"blocks\":[{\"key\":\"3oo0h\",\"text\":\"I know in the Ruby language, you could have implicit returns. \",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}},{\"key\":\"a4av9\",\"text\":\"\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}},{\"key\":\"ak4d3\",\"text\":\"Do implicit returns exist in Javascript? And if so, when are they used? I think implicit functions might be used in arrow functions, but I'm not entirely sure. \",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}}],\"entityMap\":{}}", user_id: 30},
  {title: "What is the difference between \"let\", \"const\" and \"var\" in Javascript? ", body: "{\"blocks\":[{\"key\":\"2j68h\",\"text\":\"I keep seeing that it's better to refactor var into let and const, and that let and const were both recently introduced by ES6? \",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[{\"offset\":43,\"length\":3,\"style\":\"CODE\"},{\"offset\":52,\"length\":3,\"style\":\"CODE\"},{\"offset\":60,\"length\":5,\"style\":\"CODE\"},{\"offset\":76,\"length\":3,\"style\":\"CODE\"},{\"offset\":84,\"length\":5,\"style\":\"CODE\"}],\"entityRanges\":[],\"data\":{}},{\"key\":\"99u3o\",\"text\":\"\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}},{\"key\":\"5p70m\",\"text\":\"And something related to block scoping? Can someone explain this to me?  \",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}}],\"entityMap\":{}}", user_id: 30},
  {title: "What is currying? ", body: "{\"blocks\":[{\"key\":\"50tc4\",\"text\":\"It is to my understanding that currying allows you to chain multiple functions together. So something like this: \",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}},{\"key\":\"cre6a\",\"text\":\"\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}},{\"key\":\"ev0sb\",\"text\":\"function nonCurry(a, b, c) {\\n    return [a, b, c]; \\n}\",\"type\":\"code-block\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}},{\"key\":\"7a3ep\",\"text\":\"\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}},{\"key\":\"a2efg\",\"text\":\"can be written like this instead: \",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}},{\"key\":\"7fj3d\",\"text\":\"\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}},{\"key\":\"ago3e\",\"text\":\"function curry(a) {\\n    return function(b) {\\n        return function(c) {\\n            return [a, b, c]; \\n        }\\n    }\\n}\",\"type\":\"code-block\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}},{\"key\":\"9s0h1\",\"text\":\"\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}},{\"key\":\"6rrmo\",\"text\":\"Is this a correct understanding of currying? And why is currying useful? \",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}}],\"entityMap\":{}}", user_id: 30},
  {title: "Best way to go about implementing a votes model? ", body: "{\"blocks\":[{\"key\":\"b2ogq\",\"text\":\"Currently I'm trying to figure out the best way to go about implementing an upvote/downvote system in my application. \",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}},{\"key\":\"65oof\",\"text\":\"\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}},{\"key\":\"9u3u5\",\"text\":\"Should I have one table for upvotes and a separate table for downvotes? \",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[{\"offset\":28,\"length\":7,\"style\":\"CODE\"},{\"offset\":61,\"length\":9,\"style\":\"CODE\"}],\"entityRanges\":[],\"data\":{}}],\"entityMap\":{}}", user_id: 30},
  {title: "How do I remove the question mark at the end of a key in my json.jbuilder file", body: "{\"blocks\":[{\"key\":\"1jk26\",\"text\":\"I have a ruby boolean method (that ends with ? as per Ruby tradition) that I want to extract in my json.jbuilder file. How do I remove the ? in my jbuilder file? \",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[{\"offset\":45,\"length\":1,\"style\":\"CODE\"},{\"offset\":139,\"length\":1,\"style\":\"CODE\"}],\"entityRanges\":[],\"data\":{}}],\"entityMap\":{}}", user_id: 30},
  {title: "How do I prevent the form from submitting when I press enter? ", body: "{\"blocks\":[{\"key\":\"dvs9n\",\"text\":\"I currently have a react form that looks like this: \",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}},{\"key\":\"8ihdb\",\"text\":\"\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}},{\"key\":\"bt0jf\",\"text\":\"<form onSubmit={this.handleSubmit}>\\n    <label>Add Tag:\\n        <input onChange={this.handleChange} />\\n    </label>\\n    <button type=\\\"submit\\\">Submit</button>\\n        {errors ? errors.map((error, idx) =>\\n            <li key={idx}>{error}</li>)\\n            :\\n        null}\\n</form>\",\"type\":\"code-block\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}},{\"key\":\"28pos\",\"text\":\"\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}},{\"key\":\"c79be\",\"text\":\"But whenever I press enter, the form automatically submits. How do I prevent this from happening? \",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}}],\"entityMap\":{}}", user_id: 30}
])
